import React from 'react'
import GoogleMapReact from 'google-map-react';

function Map() {
    const coordinates = { lat: 0 ,lng: 0};

    return (
    
    <div class="container">
        <GoogleMapReact
        bootstrapURLKeys={{ key: "" }}
        defaultCenter={defaultProps.center}
        defaultZoom={defaultProps.zoom}
      >
        <AnyReactComponent
          lat={59.955413}
          lng={30.337844}
          text="My Marker"
        />
      </GoogleMapReact>
    </div>
  );
}

export default Map;
